import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import CreateAccount from "./Pages/01_CreateAccount";

const Home = () => <div> Test </div>;

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/">
          <Home />
        </Route>
        <Route path="/about">
          <CreateAccount />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
